import React, { useState } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const MethodologyContainer = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  color: #1e3a8a;
  margin-bottom: 15px;
  text-align: center;
`;

const SectionSubtitle = styled.p`
  font-size: 1.1rem;
  color: #64748b;
  text-align: center;
  margin-bottom: 40px;
  line-height: 1.6;
`;

const MethodSection = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 35px;
  margin-bottom: 30px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border: 1px solid #e2e8f0;
`;

const MethodTitle = styled.h3`
  font-family: 'Merriweather', serif;
  font-size: 1.6rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  display: flex;
  align-items: center;
  gap: 12px;
`;

const MethodContent = styled.div`
  font-size: 1rem;
  line-height: 1.7;
  color: #374151;
`;

const DetailBox = styled.div`
  background: ${props => {
    switch(props.type) {
      case 'data': return 'linear-gradient(135deg, #dbeafe, #bfdbfe)';
      case 'analysis': return 'linear-gradient(135deg, #d1fae5, #a7f3d0)';
      case 'limitation': return 'linear-gradient(135deg, #fef3c7, #fde68a)';
      default: return 'linear-gradient(135deg, #f3f4f6, #e5e7eb)';
    }
  }};
  padding: 25px;
  border-radius: 15px;
  border-left: 4px solid ${props => {
    switch(props.type) {
      case 'data': return '#3b82f6';
      case 'analysis': return '#10b981';
      case 'limitation': return '#f59e0b';
      default: return '#6b7280';
    }
  }};
  margin: 20px 0;
`;

const DetailTitle = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: #1f2937;
  margin-bottom: 12px;
`;

const DetailText = styled.div`
  font-size: 0.95rem;
  line-height: 1.6;
  color: #374151;
`;

const StepsList = styled.ol`
  padding-left: 20px;
  margin: 20px 0;
`;

const StepItem = styled.li`
  margin-bottom: 15px;
  font-size: 0.95rem;
  line-height: 1.6;
  color: #374151;
`;

const CodeBlock = styled.pre`
  background: #1f2937;
  color: #e5e7eb;
  padding: 20px;
  border-radius: 10px;
  overflow-x: auto;
  font-size: 0.9rem;
  line-height: 1.4;
  margin: 20px 0;
  border: 1px solid #374151;
`;

const TabContainer = styled.div`
  display: flex;
  margin-bottom: 25px;
  border-bottom: 2px solid #e2e8f0;
`;

const Tab = styled.button`
  background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'transparent'};
  color: ${props => props.active ? 'white' : '#64748b'};
  border: none;
  padding: 12px 20px;
  font-size: 0.95rem;
  font-weight: 600;
  cursor: pointer;
  border-radius: 8px 8px 0 0;
  transition: all 0.3s ease;
  margin-right: 5px;

  &:hover {
    background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'rgba(100, 116, 139, 0.1)'};
  }
`;

const DataFlowDiagram = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 30px 0;
  padding: 25px;
  background: #f8fafc;
  border-radius: 15px;
  border: 1px solid #e2e8f0;
`;

const FlowStep = styled.div`
  text-align: center;
  flex: 1;
  padding: 0 10px;
`;

const FlowIcon = styled.div`
  width: 60px;
  height: 60px;
  background: ${props => {
    switch(props.step) {
      case 1: return 'linear-gradient(135deg, #3b82f6, #1e40af)';
      case 2: return 'linear-gradient(135deg, #10b981, #059669)';
      case 3: return 'linear-gradient(135deg, #f59e0b, #d97706)';
      case 4: return 'linear-gradient(135deg, #ef4444, #dc2626)';
      default: return 'linear-gradient(135deg, #6b7280, #4b5563)';
    }
  }};
  color: white;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0 auto 15px;
  font-size: 1.5rem;
  font-weight: bold;
`;

const FlowTitle = styled.div`
  font-size: 1rem;
  font-weight: 600;
  color: #1f2937;
  margin-bottom: 8px;
`;

const FlowDescription = styled.div`
  font-size: 0.85rem;
  color: #6b7280;
  line-height: 1.4;
`;

const Arrow = styled.div`
  font-size: 1.5rem;
  color: #9ca3af;
  margin: 0 10px;
`;

const MethodologyDetails = () => {
  const [activeTab, setActiveTab] = useState('datacollection');

  const renderDataCollection = () => (
    <div>
      <DetailBox type="data">
        <DetailTitle>Primary Data Source</DetailTitle>
        <DetailText>
          <strong>Centers for Medicare & Medicaid Services (CMS) Provider Enrollment, Chain, and Ownership System (PECOS)</strong><br/>
          The study utilized de-identified provider enrollment data from PECOS, which maintains comprehensive 
          records of all healthcare providers participating in Medicare and Medicaid programs across the United States.
        </DetailText>
      </DetailBox>

      <MethodContent>
        <h4 style={{ color: '#1e3a8a', marginBottom: '15px' }}>Data Collection Parameters</h4>
        <StepsList>
          <StepItem>
            <strong>Time Period:</strong> January 2016 - December 2019 (48-month longitudinal study)
          </StepItem>
          <StepItem>
            <strong>Geographic Scope:</strong> 40 states with complete data reporting (representing 85% of US population)
          </StepItem>
          <StepItem>
            <strong>Provider Types:</strong> Primary care clinicians including Family Medicine, Internal Medicine, 
            Pediatrics, OB/GYN, Nurse Practitioners, and Physician Associates
          </StepItem>
          <StepItem>
            <strong>Inclusion Criteria:</strong> Active Medicaid enrollment for ≥12 consecutive months during study period
          </StepItem>
          <StepItem>
            <strong>Exclusion Criteria:</strong> Specialists, hospital-based providers, locum tenens, and providers 
            with incomplete enrollment data
          </StepItem>
        </StepsList>
      </MethodContent>

      <DataFlowDiagram>
        <FlowStep>
          <FlowIcon step={1}>1</FlowIcon>
          <FlowTitle>Raw PECOS Data</FlowTitle>
          <FlowDescription>2.8M provider records extracted</FlowDescription>
        </FlowStep>
        <Arrow>→</Arrow>
        <FlowStep>
          <FlowIcon step={2}>2</FlowIcon>
          <FlowTitle>Filtering & Cleaning</FlowTitle>
          <FlowDescription>Applied inclusion/exclusion criteria</FlowDescription>
        </FlowStep>
        <Arrow>→</Arrow>
        <FlowStep>
          <FlowIcon step={3}>3</FlowIcon>
          <FlowTitle>Longitudinal Linking</FlowTitle>
          <FlowDescription>Matched providers across time periods</FlowDescription>
        </FlowStep>
        <Arrow>→</Arrow>
        <FlowStep>
          <FlowIcon step={4}>4</FlowIcon>
          <FlowTitle>Final Dataset</FlowTitle>
          <FlowDescription>220,665 analyzable providers</FlowDescription>
        </FlowStep>
      </DataFlowDiagram>

      <DetailBox type="limitation">
        <DetailTitle>Data Limitations</DetailTitle>
        <DetailText>
          While PECOS provides comprehensive enrollment data, it does not capture actual patient encounter 
          volumes or reimbursement amounts. Participation changes were inferred from enrollment status 
          and self-reported patient volume estimates, which may introduce measurement error.
        </DetailText>
      </DetailBox>
    </div>
  );

  const renderAnalyticalApproach = () => (
    <div>
      <DetailBox type="analysis">
        <DetailTitle>Statistical Framework</DetailTitle>
        <DetailText>
          The analysis employed a multi-stage approach combining descriptive statistics, inferential testing, 
          and predictive modeling to identify patterns and determinants of Medicaid participation changes.
        </DetailText>
      </DetailBox>

      <MethodContent>
        <h4 style={{ color: '#1e3a8a', marginBottom: '15px' }}>Outcome Variable Definition</h4>
        <p>
          Participation change was categorized using a 90% threshold based on baseline patient volume:
        </p>
        <StepsList>
          <StepItem>
            <strong>Stable:</strong> Change in Medicaid patient volume between -90% and +90% of baseline
          </StepItem>
          <StepItem>
            <strong>Major Increase:</strong> Increase of >90% from baseline (e.g., 50 to >95 patients)
          </StepItem>
          <StepItem>
            <strong>Major Decrease:</strong> Decrease of >90% from baseline (e.g., 100 to &lt;10 patients)
          </StepItem>
        </StepsList>

        <h4 style={{ color: '#1e3a8a', marginBottom: '15px', marginTop: '30px' }}>Statistical Models</h4>

        <div style={{ marginBottom: '25px' }}>
          <strong>1. Binary Logistic Regression (Stable vs Volatile)</strong>
          <CodeBlock>
{`logit(P(Stable)) = β₀ + β₁(BaselineVolume) + β₂(CHC) + 
                    β₃(Rural) + β₄(ExpansionState) + 
                    β₅(ProviderType) + β₆(YearsInPractice) + ε`}
          </CodeBlock>
        </div>

        <div style={{ marginBottom: '25px' }}>
          <strong>2. Multinomial Logistic Regression (Three-Category Outcome)</strong>
          <CodeBlock>
{`log(P(MajorIncrease)/P(Stable)) = α₁ + X'β₁
log(P(MajorDecrease)/P(Stable)) = α₂ + X'β₂

Where X includes all predictor variables`}
          </CodeBlock>
        </div>

        <div>
          <strong>3. Mixed-Effects Models (State-Level Clustering)</strong>
          <CodeBlock>
{`Yᵢⱼ = Xᵢⱼβ + Zᵢⱼuⱼ + εᵢⱼ

Where uⱼ ~ N(0, G) represents state-level random effects`}
          </CodeBlock>
        </div>
      </MethodContent>

      <DetailBox type="data">
        <DetailTitle>Model Validation</DetailTitle>
        <DetailText>
          Cross-validation was performed using 80/20 train-test split with stratified sampling. 
          Model performance was evaluated using accuracy, precision, recall, and AUC-ROC metrics. 
          Bootstrap resampling (n=1000) was used to generate robust confidence intervals.
        </DetailText>
      </DetailBox>
    </div>
  );

  const renderQualityAssurance = () => (
    <div>
      <DetailBox type="analysis">
        <DetailTitle>Data Quality Framework</DetailTitle>
        <DetailText>
          Rigorous quality assurance procedures were implemented to ensure data integrity and 
          analytical validity throughout the research process.
        </DetailText>
      </DetailBox>

      <MethodContent>
        <h4 style={{ color: '#1e3a8a', marginBottom: '15px' }}>Data Cleaning Procedures</h4>
        <StepsList>
          <StepItem>
            <strong>Duplicate Detection:</strong> Identified and resolved 12,847 duplicate provider records 
            using National Provider Identifier (NPI) matching
          </StepItem>
          <StepItem>
            <strong>Missing Data Assessment:</strong> Systematic evaluation of missing data patterns, 
            with &lt;5% missingness for key variables
          </StepItem>
          <StepItem>
            <strong>Outlier Analysis:</strong> Statistical outlier detection using interquartile range 
            and z-score methods, identifying 2.3% extreme values for sensitivity analysis
          </StepItem>
          <StepItem>
            <strong>Temporal Consistency:</strong> Validation of provider records across time points, 
            ensuring logical sequence of enrollment changes
          </StepItem>
        </StepsList>

